void	temp_texture_skybox(t_drown *d)
{
	d->index.x = 0;
	d->index.y = 0;
		while (d->index.y <= 63)
		{
			while (d->index.x <= 127)
			{
				d->gfx.txt.skybox[d->index.y][d->index.x]
					= skybox_to_data(d->index.y, d->index.x);
				d->index.x++;
			}
			d->index.y++;
			d->index.x = 0;
		}
		d->index.y = 0;
}

